"], "63": ["Рисунок красивый, клеится хорошо. Но нет краешка без пленки и направляющие линии с обратной стороны напечатаны не сплошным рисунком, а как бы отдельными частями, которые не совпадают друг с другом, так что по ним невозможно высчитать нужную длину и отрезать. Это неудобно.", "2021-01-13T18:01:25Z", "белый, черный, розовый", "0", 2, 0, 4, "Пленка самоклеящаяся универсальная с ХУДОЖЕСТВЕННЫМ рисунком 8 метров*45см, для мебели, ремонта", "JADECO"], "64": ["Взяла для ванной комнаты. Стены были покрашены водоэмульсионной краской для влажных помещений. Удалила все отслоения. Загрунтовала стены 2 раза грунтовкой глубокого проникновения для сцепки с поверхностью. Клеили в нахлест. Вроде хорошо получилось. Клеевая основа слабее, чем у самоклейки под белые доски. Ее брала для шкафчиков на кухне. Та хорошо прихватывалась и к краске. Эту же пришлось по краям хорошенько продавливать.", "2021-01-10T00:07:32Z", "белый, черный, розовый", "0", 20, 1, 5, "Пленка самоклеящаяся универсальная с ХУДОЖЕСТВЕННЫМ рисунком 8 метров*45см, для мебели, ремонта", "JADECO"], "65": ["Оклеили еще экран под ванной. Отлично клеится на пластик.", "2021-01-11T00:07:35Z", "белый, черный, розовый", "0", 0, 1, 5, "Пленка самоклеящаяся универсальная с ХУДОЖЕСТВЕННЫМ рисунком 8 метров*45см, для мебели, ремонта", "JADECO"], "66": ["Классная плёнка, клеится хорошо на очень неровную поверхность", "2021-01-10T16:52:28Z", "белый, черный, розовый", "0", 3, 1, 5, "Пленка самоклеящаяся универсальная с ХУДОЖЕСТВЕННЫМ рисунком 8 метров*45см, для мебели, ремонта", "JADECO"], "67": ["Хорошая плёнка.", "2021-01-08T09:24:06Z", "болотный, серо-зеленый", "0", 3, 2, 5, "Пленка самоклеящаяся универсальная с ХУДОЖЕСТВЕННЫМ рисунком 8 метров*45см, для мебели, ремонта", "JADECO"], "68": ["Отличная пленка. Качеством довольна", "2021-01-07T21:43:48Z", "", "0", 0, 1, 5, "Пленка самоклеящаяся универсальная с ХУДОЖЕСТВЕННЫМ рисунком 8 метров*45см, для мебели, ремонта", "JADECO"], "69": ["Пленка просвечивает и рвется, я не