ели, ремонта", "JADECO"], "100": ["Плёнка потрясающая,спокойный цвет.Обклеяла ей кухню- все заценили👍 Единственное пожелание,чтобы такая же плёнка была по 60см и 90 см.", "2020-11-16T19:24:29Z", "бледно-голубой, болотный, бледно-розовый", "0", 1, 1, 5, "Пленка самоклеящаяся универсальная с ХУДОЖЕСТВЕННЫМ рисунком 8 метров*45см, для мебели, ремонта", "JADECO"], "101": ["Отличная пленка. Клеила на стекло, расглажива сухой тряпочкой. Легла хорошо, было несколько пузырей, проколола иглой и выпустила воздух.", "2020-11-16T10:37:28Z", "", "0", 6, 2, 5, "Пленка самоклеящаяся универсальная с ХУДОЖЕСТВЕННЫМ рисунком 8 метров*45см, для мебели, ремонта", "JADECO"], "102": ["Восторга нет,тонкая очень,чуть потянул и рвётся как бумага. Идеально клеится только к идеально ровной поверхности,нужно грунтовать. Для кухни не рискнула бы,от воздействия тепла отклеится сразу.", "2020-11-16T08:01:26Z", "белый, черный, серый", "0", 5, 1, 3, "Пленка самоклеящаяся универсальная с ХУДОЖЕСТВЕННЫМ рисунком 8 метров*45см, для мебели, ремонта", "JADECO"], "103": ["Пленка хорошая..клеевая основа хорошая..", "2020-11-13T20:50:41Z", "белый, черный, серый", "0", 1, 2, 5, "Пленка самоклеящаяся универсальная с ХУДОЖЕСТВЕННЫМ рисунком 8 метров*45см, для мебели, ремонта", "JADECO"], "104": ["плëнка понравилась. в деле бледнее чем на фото. как будто выгорела на солнце. оклеила страшную грязную от времени стену.  стена была крашеная, в местах есть неровности. ничего не подготавливала, не очищала. прям так и оклеила.  отлично приклеилась. дальше время покажет.", "2020-11-12T15:13:06Z", "белый, черный, розовый", "0", 23, 1, 5, "Пленка самоклеящаяся универсальная с ХУДОЖЕСТВЕННЫМ рисунком 8 метров*45см, для мебели, ремонта", "JADECO"], "105": ["Тонковата,но клеится хорошо,немного растягивается если переклеивать ,клеила на старую пленку,темные цветы немного просвечивают,но это если присматриваться. В целом очень довольна,клеила одна туалет,все получилось", "2020-11-11T13:37:00Z", "белый, черный, серый", "0", 1